import React, { useState } from 'react';
import { Formik, Form, Field, ErrorMessage } from 'formik';
import * as Yup from 'yup';
import '../UserProfilePage.css';

const UserProfilePage = ({ name }) => {
  const initialValues = {
    name: name || '',
    username: '',
    bio: '',
    location: '',
    photo: null,
  };

  const validationSchema = Yup.object({
    name: Yup.string().required('Required'),
    username: Yup.string().required('Required'),
    bio: Yup.string(),
    location: Yup.string(),
    photo: Yup.mixed(),
  });

  const handleSubmit = (values) => {
    // Here you can handle form submission, e.g., send data to an API
    console.log(values);
  };

  const [isUploadClicked, setIsUploadClicked] = useState(false);

  const handleUploadClick = () => {
    setIsUploadClicked(true);
  };

  return (
    <div>
      <h1>User Profile</h1>
      <Formik
        initialValues={initialValues}
        validationSchema={validationSchema}
        onSubmit={handleSubmit}
      >
        <Form>
          <div className="form-field">
            <div className="photo-upload-container">
              <Field type="file" id="photo" name="photo" className="hidden-input" />
              <ErrorMessage name="photo" component="div" />
              {initialValues.photo ? (
                <img src={URL.createObjectURL(initialValues.photo)} alt="Uploaded" className="uploaded-photo" />
              ) : (
                <div className={`empty-photo-circle ${isUploadClicked ? 'upload-clicked' : ''}`} onClick={handleUploadClick}>
                  <div className="upload-icon">+</div>
                </div>
              )}
            </div>
          </div>
          <div className="form-field">        
            <label htmlFor="name">Name:</label>
            <Field type="text" id="name" name="name" />
            <ErrorMessage name="name" component="div" />
          </div>
          <div className="form-field">
            <label htmlFor="username">Username:</label>
            <Field type="text" id="username" name="username" />
            <ErrorMessage name="username" component="div" />
          </div>
          <div className="form-field">
            <label htmlFor="bio">Bio:</label>
            <Field as="textarea" id="bio" name="bio" />
            <ErrorMessage name="bio" component="div" />
          </div>
          <div className="form-field">
            <label htmlFor="location">Location:</label>
            <Field type="text" id="location" name="location" />
            <ErrorMessage name="location" component="div" />
          </div>
          <button type="submit">Save</button>
        </Form>
      </Formik>
    </div>
  );
};

export default UserProfilePage;
